import React, { useState, useEffect } from 'react';

function HeaderHistory({ whichPage, allOpen }) {
  const [activeTab, setActiveTab] = useState(whichPage);

  useEffect(() => {
    setActiveTab(whichPage);
  }, [whichPage]);

  const handleTabClick = (tabId) => {
    setActiveTab(tabId);
  };

  return (
    <div className="mb-4 border-b border-gray-200 dark:border-gray-700">
      <ul className="flex flex-wrap -mb-px text-sm font-medium text-center" id="myTab" data-tabs-toggle="#myTabContent" role="tablist">
        <li className="mr-2" role="presentation">
          <button
            className={`inline-block p-4 border-b-2 rounded-t-lg ${
              activeTab === 'profile'
                ? 'border-indigo-500'
                : allOpen
                ? 'border-transparent'
                : 'hidden'
            }`}
            id="profile-tab"
            data-tabs-target="#profile"
            type="button"
            role="tab"
            aria-controls="profile"
            aria-selected={activeTab === 'profile'}
            onClick={() => handleTabClick('profile')}
          >
            Profile
          </button>
        </li>
        <li className="mr-2" role="presentation">
          <button
           className={`inline-block p-4 border-b-2 rounded-t-lg ${
            activeTab === 'dashboard'
              ? 'border-indigo-500'
              : allOpen
              ? 'border-transparent'
              : 'hidden'
          } hover:text-gray-600 hover:border-gray-300 dark:hover:text-gray-300`}
            id="dashboard-tab"
            data-tabs-target="#dashboard"
            type="button"
            role="tab"
            aria-controls="dashboard"
            aria-selected={activeTab === 'dashboard'}
            onClick={() => handleTabClick('dashboard')}
          >
            Dashboard
          </button>
        </li>
      </ul>

      <div id="myTabContent">
        <div className={`p-4 rounded-lg ${activeTab === 'profile' ? 'bg-gray-50 dark:bg-gray-800' : 'hidden'}`} id="profile" role="tabpanel" aria-labelledby="profile-tab">
          <p className="text-sm text-gray-500 dark:text-gray-400">This is some placeholder content the <strong className="font-medium text-gray-800 dark:text-white">Profile tab's associated content</strong>. Clicking another tab will toggle the visibility of this one for the next. The tab JavaScript swaps classes to control the content visibility and styling.</p>
        </div>
        <div className={`p-4 rounded-lg ${activeTab === 'dashboard' ? 'bg-gray-50 dark:bg-gray-800' : 'hidden'}`} id="dashboard" role="tabpanel" aria-labelledby="dashboard-tab">
          <p className="text-sm text-gray-500 dark:text-gray-400">This is some placeholder content the <strong className="font-medium text-gray-800 dark:text-white">Dashboard tab's associated content</strong>. Clicking another tab will toggle the visibility of this one for the next. The tab JavaScript swaps classes to control the content visibility and styling.</p>
        </div>
      </div>
    </div>
  );
}

export default HeaderHistory;
